define([],function(){return function(e){e.controller("renderController",["$scope","$http","$location","baseUrl",function(e,t,n,r){var i=n.search().id;if(i=="localSource"){var s=JSON.parse(localStorage.getItem("article"));e.tree=s.content,e.type=s.type,e.title=s.title,e.source=s.source}else t({url:r.baseUrl+"system/content/filter/queryContentById_async",method:"get",params:{id:i}}).success(function(t){t.success&&(e.tree=t.data.contentObj,e.type=t.data.type,e.title=t.data.title,e.source=t.data.source)})}]),e.controller("navbarController",["$scope","$http","baseUrl",function(e,t,n){t({url:n.baseUrl+"system/user/getSysUserRealName_async",method:"get"}).success(function(t){e.data=t})}])}});
